import React from 'react';
import { BrowserRouter, Route }  from 'react-router-dom'
import Footer from './components/Footer';
import Header from './components/Header';
import Home from './pages/Home';
import './styles/global.scss';

function App() {
    return (
        <BrowserRouter>
            <Header />
                <Route element={<Home />} />
            <Footer />
        </BrowserRouter>
    );
}

export default App;
